export default function Tags() {
    return (
        <div className="tags">
            <ul>
                <li><a href="">All</a> </li>
                <li> <a href="">Kitchenware</a></li>
                <li> <a href="">Drinkware</a></li>
                <li>Bags</li>
            </ul>

        </div>
    )
}
